Y gracias también a la persona que me salvó el día en el atasco del canal de Suez. Mi carguero quedó atrapado y tras horas de bochorno apareció 
@Santi_ACASBAL, que de forma anónima y sin fotógrafos detrás, llevaba todo el día ayudando a la gente.
Agradecimiento eterno. https://t.co/XrRDO5UO57
